(1, 'seo.data', '{\"seo_image\":\"1\",\"keywords\":[\"exchange platform\",\"currency exchange platform\",\"changalab\",\"usd to inr\",\"currency exchnage\",\"easy exchange\",\"money exhcngae\",\"bitcoin to usd\",\"money exchange\",\"crypto currency exchange\",\"crypto currency\"],\"description\":\"ChangaLab can be explained as a network of buyers and sellers, who transfer currency between each other or for their own. It is the means by which individuals, and companies convert one currency into another. This Currency Exchange Platform is the most advanced script in Codecanyon. The Currency Exchange Platform is endlessly appealing, feature-loaded, customized, and possesses the remarkable capability of running on all devices and operating systems.\",\"social_title\":\"ChangaLab - Currency Exchange Platform\",\"social_description\":\"ChangaLab can be explained as a network of buyers and sellers, who transfer currency between each other or for their own. It is the means by which individuals, companies convert one currency into another. This Currency Exchange Platform is the most advanced script in Codecanyon. The Currency Exchange Platform is endlessly appealing, feature-loaded, customized, and possesses the remarkable capability of running on all devices and operating systems.\",\"image\":\"66a8bb8d116e21722334093.png\"}', NULL, NULL, '', '2020-07-04 05:42:52', '2024-07-30 04:08:29'),
(24, 'about.content', '{\"has_image\":\"1\",\"heading\":\"AEFA Changer\",\"subheading\":\"Trusted Currency Exchange Services in Dubai & Pakistan\",\"description\":\"<h3><span style=\\\"font-size:0.875rem;\\\">At\\u00a0<\\/span><span style=\\\"font-size:14px;\\\"><b>AEFA Changer<\\/b><\\/span><\\/h3><h3><span style=\\\"font-size:0.875rem;\\\">we pride ourselves on being a reliable and secure platform for all your currency exchange needs. With years of experience in the financial exchange sector, we\\u2019ve built a reputation for transparency, speed, and the best market rates in both <\\/span><b style=\\\"font-size:0.875rem;\\\">Dubai<\\/b><span style=\\\"font-size:0.875rem;\\\">\\u00a0<\\/span><span style=\\\"font-size:0.875rem;\\\">and <b>Pakistan<\\/b><\\/span><span style=\\\"font-size:0.875rem;\\\">.<\\/span><\\/h3>\\n<p>Whether you\'re a traveler, a business professional, or someone who regularly deals in foreign currencies, AEFA Changer makes the process simple and seamless. Our team is committed to offering a hassle-free experience backed by real-time exchange rates and dedicated customer support.<\\/p><p><br \\/><\\/p>\\n<h3>ICash.one \\u2013 Fast USD & AED Exchange<\\/h3>\\n<p><strong>ICash.one<\\/strong> is your go-to solution for exchanging <strong>USD<\\/strong> and <strong>AED<\\/strong> with confidence. We understand the importance of fast, secure, and accurate transactions \\u2014 and that\\u2019s exactly what we deliver. With ICash.one, you can exchange your money with complete peace of mind, knowing you\'re getting competitive rates and a professional service.<\\/p>\\n<p>Whether you\'re in Dubai or Pakistan, our platforms are designed to serve you efficiently \\u2014 bridging the gap between reliability and convenience.<\\/p>\\n<hr \\/>\\n<p><strong>Why Choose Us?<\\/strong><\\/p>\\n<ul>\\n<li>\\n<p>\\u2705 <strong>Best Exchange Rates<\\/strong><\\/p>\\n<\\/li>\\n<li>\\n<p>\\ud83d\\udd12 <strong>Safe & Secure Transactions<\\/strong><\\/p>\\n<\\/li>\\n<li>\\n<p>\\u26a1 <strong>Quick & Hassle-Free Process<\\/strong><\\/p>\\n<\\/li>\\n<li>\\n<p>\\ud83c\\udf0d <strong>Serving Clients Across Dubai & Pakistan<\\/strong><\\/p>\\n<\\/li>\\n<li>\\n<p>\\ud83d\\udcac <strong>Dedicated Customer Support<br \\/><\\/strong><\\/p><\\/li><\\/ul>\",\"about_image\":\"63cfac0241e491674554370.png\"}', NULL, 'orange_oasis', '', '2020-10-27 06:51:20', '2025-03-27 21:28:16'),
